css:
.editor-colors {
  background-color: #151515;
  color: #e8e8d3;
}
.editor {
  background-color: #151515;
  color: #e8e8d3;
}
.editor .wrap-guide {
  background-color: #373737;
}
.editor .indent-guide {
  color: #373737;
}
.editor .invisible-character {
  color: #373737;
}
.editor .gutter {
  background-color: #151515;
  color: #373737;
}
.editor .gutter .line-number.cursor-line {
  background-color: #010101;
  color: #373737;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #373737;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #373737;
}
.editor .invisible {
  color: #373737;
}
.editor .cursor {
  color: #b0d0f0;
}
.editor .selection .region {
  background-color: #404040;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #b0d0f0;
}
.editor .search-results .marker.current-result .region {
  border: 1px solid #b0d0f0;
}
.comment {
  color: #888888;
}
.entity.name.type {
  color: #ffb964;
}
.entity.other.inherited-class {
  color: #ffb964;
}
.keyword {
  color: #8fbfdc;
}
.keyword.control {
  color: #8fbfdc;
}
.keyword.operator {
  color: #e8e8d3;
}
.keyword.other.special-method {
  color: #ffb964;
}
.keyword.other.unit {
  color: #ffb964;
}
.storage {
  color: #e8e8d3;
}
.constant.character.escape {
  color: #558f1f;
}
.constant.numeric {
  color: #cf6a4c;
}
.constant.other.color {
  color: #cf6a4c;
}
.constant.other.symbol {
  color: #8fbfdc;
}
.variable {
  color: #ffb964;
}
.variable.interpolation {
  color: #ffa231;
}
.variable.parameter.function {
  color: #ffb964;
}
.invalid.illegal {
  background-color: #ac4142;
  color: #151515;
}
.string {
  color: #99ad6a;
}
.string.regexp {
  color: #dd0093;
}
.string.regexp .source.ruby.embedded {
  color: #e8e8d3;
}
.string.regexp .punctuation.definition.string {
  color: #dd0093;
}
.string.regexp .constant.character.escape {
  color: #967efb;
}
.string.regexp .operator {
  color: #dd0093;
}
.string.regexp .keyword.control {
  color: #dd0093;
}
.string.other.link {
  color: #556633;
}
.punctuation.definition.comment {
  color: #888888;
}
.punctuation.definition.string {
  color: #556633;
}
.punctuation.definition.heading,
.punctuation.definition.identity {
  color: #8fbfdc;
}
.punctuation.definition.bold {
  color: #7697d6;
  font-style: bold;
}
.punctuation.definition.italic {
  color: #7697d6;
  font-style: italic;
}
.support.class {
  color: #ffb964;
}
.support.function {
  color: #fad07a;
}
.support.function.any-method {
  color: #fad07a;
}
.entity.name.function {
  color: #fad07a;
}
.entity.name.class,
.entity.name.type.class {
  color: #ffb964;
}
.entity.name.section {
  color: #7697d6;
}
.entity.name.tag {
  color: #ffb964;
}
.entity.other.attribute-name {
  color: #ffb964;
}
.entity.other.attribute-name.id {
  color: #8fbfdc;
}
.meta.class {
  color: #e8e8d3;
}
.meta.link {
  color: #a1000d;
}
.meta.require {
  color: #7697d6;
}
.meta.selector {
  color: #967efb;
}
.meta.separator {
  background-color: #373737;
  color: #e8e8d3;
}
.none {
  color: #e8e8d3;
}
.markup.bold {
  color: #ffb964;
  font-style: bold;
}
.markup.changed {
  color: #558f1f;
}
.markup.deleted {
  color: #ac4142;
}
.markup.italic {
  color: #ffb964;
  font-style: italic;
}
.markup.heading .punctuation.definition.heading {
  color: #7697d6;
}
.markup.inserted {
  color: #558f1f;
}
.markup.list {
  color: #ffb964;
}
.markup.quote {
  color: #99ad6a;
}
.markup.raw.inline {
  color: #99ad6a;
}
.source.gfm .constant {
  color: #888888;
}
.source.gfm .link {
  color: #99ad6a;
}
.source.gfm .markup {
  -webkit-font-smoothing: auto;
}
.source.gfm .markup.heading {
  color: #ffb964;
}
.editor.mini .scroll-view {
  padding-left: 1px;
}
